import React from "react";
import { motion } from "framer-motion";
const App = () => {
  const variants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1 },
  };

  return (
    <motion.div
      initial="hidden"
      animate="visible"
      variants={variants}
      className="carre"
    ></motion.div>
  );
};

export default App;
